              className="bg-secondary pl-2 text-white w-50 form-control"
              name="nick"
              placeholder="10"
              onChange={e =>{setsmell(e)}}
            />
          </div>
        </div>
        <div className="col">
          {/* input type */}
          <label className="">VOICE</label>
          <div className="input-group">
            <input
              maxLength={500}
              type="number"
              className="bg-secondary pl-2 text-white w-50 form-control"
              name="nick"
              placeholder="10"
              onChange={e =>{setvoice(e)}}
            />
          </div>
        </div>
      </div>

      {/* checkbox */}
      <div className="form-group">
        <label className="medic">Medical option</label>
        <input
          type="checkbox"
          id="vehicle1"
          name="vehicle1"
          value="Bike"
        ></input>
      </div>

      {/* Personality Attributes */}

      <div className="row form-group">
        {/* input type */}
        <div className="col">
          <label className="">Intelligence</label>
          <div className="input-group">
            <input
              maxLength={500}
              type="number"
              className="bg-secondary pl-2 text-white w-50 form-control"
              name="nick"
              placeholder="10"
              onChange={e =>{setintelligence(e)}}
            />
          </div>
        </div>
        <div className="col">
          {/* input type */}
          <label className="">Aura</label>
          <div className="input-group">
            <input
              maxLength={500}
              type="number"
              className="bg-secondary pl-2 text-white w-50 form-control"
              name="nick"
              placeholder="10"
              onChange={e =>{setAura(e)}}
            />
          </div>
        </div>
        <div className="col">
          {/* input type */}
          <label className="">Will</label>
          <div className="input-group">
            <input
              maxLength={500}
              type="number"
              className="bg-secondary pl-2 text-white w-50 form-control"
              name="nick"
              placeholder="10"
              onChange={e =>{setwill(e)}}
            />
          </div>
        </div>
      </div>
      {/* triple content /  format */}
      {/*  second stats */}

      <div className="row form-group">
        {/* input type */}
        <div className="col">
          <label className="">Morality</label>
