            <option value="null">Attractive</option>
            <option value="null">Handsome</option>
          </select>
        </div>
        <div className="col">
          <label className="">Weapon</label>
          <select
            autoComplete="off"
            className="bg-secondary pl-2 text-white form-control"
            name="group"
